// src/components/OperationForm.js
import React, { useState, useEffect } from 'react';
import axios from 'axios';

const OperationForm = () => {
    const [operation, setOperation] = useState({
        id: '',
        client_name: '',
        operation_name: '',
        business_link: '',
        description: '',
        financial_instrument: '',
        sector: '',
        sub_sector: '',
        country: ''
    });
    const [operations, setOperations] = useState([]);

    useEffect(() => {
        // Fetch existing operations to populate the dropdown
        axios.get('http://localhost:8000/api/operations/')
            .then(response => {
                setOperations(response.data);
            })
            .catch(error => console.error('Error fetching operations:', error));
    }, []);

    const handleChange = (e) => {
        const { name, value } = e.target;
        setOperation({ ...operation, [name]: value });
    };

    const handleSubmit = (e) => {
        e.preventDefault();
        if (operation.id) {
            // Update existing operation
            axios.put(`http://localhost:8000/api/operations/${operation.id}/`, operation)
                .then(response => {
                    console.log('Operation updated:', response.data);
                })
                .catch(error => console.error('Error updating operation:', error));
        } else {
            // Create new operation
            axios.post('http://localhost:8000/api/operations/', operation)
                .then(response => {
                    console.log('Operation created:', response.data);
                    setOperation({ ...operation, id: '' }); // Reset form
                })
                .catch(error => console.error('Error creating operation:', error));
        }
    };

    const handleSelectChange = (e) => {
        const selectedId = e.target.value;
        if (selectedId) {
            const selectedOperation = operations.find(op => op.id === parseInt(selectedId));
            setOperation(selectedOperation);
        } else {
            setOperation({
                id: '',
                client_name: '',
                operation_name: '',
                business_link: '',
                description: '',
                financial_instrument: '',
                sector: '',
                sub_sector: '',
                country: ''
            });
        }
    };

    return (
        <div>
            <form onSubmit={handleSubmit}>
                <label>
                    ID:
                    <select name="id" value={operation.id} onChange={handleSelectChange}>
                        <option value="">Select ID</option>
                        {operations.map(op => (
                            <option key={op.id} value={op.id}>{op.id}</option>
                        ))}
                    </select>
                </label>
                <br />
                <label>
                    Client Name:
                    <input type="text" name="client_name" value={operation.client_name} onChange={handleChange} />
                </label>
                <br />
                <label>
                    Operation Name:
                    <input type="text" name="operation_name" value={operation.operation_name} onChange={handleChange} />
                </label>
                <br />
                <label>
                    Business Link:
                    <input type="text" name="business_link" value={operation.business_link} onChange={handleChange} />
                </label>
                <br />
                <label>
                    Description:
                    <textarea name="description" value={operation.description} onChange={handleChange}></textarea>
                </label>
                <br />
                <label>
                    Financial Instrument:
                    <input type="text" name="financial_instrument" value={operation.financial_instrument} onChange={handleChange} />
                </label>
                <br />
                <label>
                    Sector:
                    <input type="text" name="sector" value={operation.sector} onChange={handleChange} />
                </label>
                <br />
                <label>
                    Sub Sector:
                    <input type="text" name="sub_sector" value={operation.sub_sector} onChange={handleChange} />
                </label>
                <br />
                <label>
                    Country:
                    <input type="text" name="country" value={operation.country} onChange={handleChange} />
                </label>
                <br />
                <button type="submit">Submit</button>
            </form>
        </div>
    );
};

export default OperationForm;
